import React from 'react';

const LandingPage = () => {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Welcome to Itlaa Application</h1>
      <p>ITlaa is an advanced, feature-rich cab booking application designed using the MERN/MEAN stack technologies. The platform provides a seamless and user-friendly interface for customers to book rides, plan trips, and monitor real-time ride updates. It also includes a dedicated driver app for managing trips, routes, and earnings, along with an admin module for centralized management of drivers and services. Leveraging modern technologies like Firebase for cloud-based services and real-time notifications, SmartCab aims to enhance the travel experience for users while optimizing operations for drivers and administrators..</p>
    </div>
  );
};

export default LandingPage;
